import React from "react";
import CreateForm from "./components/CreateForm.js";
import TodoList from "./components/TodoList.js";
import "./App.css";
class App extends React.Component {
	render() {
		return (
			<div>
				<header>
					<h1>오늘 뭐하지?</h1>
				</header>
				<CreateForm />
				<TodoList />
			</div>
		);
	}
}

export default App;
